import './App.css';
import React, { useCallback, useEffect, useState } from 'react';
import { GoogleMap, useJsApiLoader, Marker } from '@react-google-maps/api';
import Papa from 'papaparse';
import * as toml from 'toml';
import { getConfig } from '@testing-library/react';

const containerStyle = {
  width: '100vw',
  height: '100vh',
};

const center = {
  lat: 29.717305869520487, 
  lng: -95.40327808240264
};

const fs = require("fs")

function Header() {
  return (
    <div className='header'>
      <h1>Rice University's Bike Rack Finder</h1>
      <h3>Looking for a bike rack next to a campus building? Look no further</h3>
    </div>
  );
}

function MyComponent() {
  const { isLoaded } = useJsApiLoader({
    googleMapsApiKey: getConfig.api.key, 
    id: 'google-map-script',
    version: 'weekly'
  });

  const [map, setMap] = useState(null);
  const [markers, setMarkers] = useState([]);

  useEffect(() => {

    function getConfig() {
      try {
        const config = toml.parse(fs.readFileSync('./apikey.toml', 'utf-8'));
        return config;
      } catch (error) {
        console.error('Error loading configuration:', error);
        return null;
      }
    }

    Papa.parse('bikeracks.csv', {
      header: true,
      complete: (results) => {
        // Extract the waypoints from the parsed CSV data
        const waypoints = results.data.map((row) => ({
          lat: parseFloat(row.WKT.match(/\((.*?)\)/)[1].split(' ')[1]),
          lng: parseFloat(row.WKT.match(/\((.*?)\)/)[1].split(' ')[0]),
          title: row.name,
          description: row.description,
          availability: row.Availability,
          // Add other properties from your CSV as needed
      }));

      setMarkers(waypoints);
    },
  });
  }, []);

  const onLoad = useCallback(function callback(map) {
    // This is just an example of getting and using the map instance!!! don't just blindly copy!
    const bounds = new window.google.maps.LatLngBounds(center);
    map.setZoom(16);

    setMap(map);
  }, []);

  const onUnmount = useCallback(function callback() {
    setMap(null);
  }, []);

  return (
    <div>
      <Header />
      {isLoaded ? (
        <GoogleMap
          mapContainerStyle={containerStyle}
          center={center}
          zoom={16}
          onLoad={onLoad}
          onUnmount={onUnmount}
        >
          {markers.map((marker, index) => (
            <Marker
            key={index}
            position={{ lat: marker.lat, lng: marker.lng }}
            title={marker.title}
            // Add other marker properties as needed
          />
          ))}
        </GoogleMap>
      ) : (
        <div>Loading...</div>
      )}
    </div>
  );
}

export default React.memo(MyComponent);
